import styles from "./App.module.css";

function App() {
  return (
  <>
	  <link href={styles} rel="stylesheet" media="screen, projection" />
	  <div className={styles.nav}>Nav</div>
	  <div className={styles.aside}>Aside</div>
	  <div className={styles.main}>Main</div>
  </>
  );
}

export default App;
